     * @memberof Datapoint
     */
    alertType?: number;
    /**
     * Current Used to send this location in microAmp Hours
     * @type {number}
     * @memberof Datapoint
     */
    currentUsed?: number;
    /**
     * GSM CSQ value
     * @type {number}
     * @memberof Datapoint
     */
    gsmSignal?: number;
    /**
     * Internal use - correlation identifier
     * @type {string}
     * @memberof Datapoint
     */
    correlationId?: string;
    /**
     *
     * @type {number}
     * @memberof Datapoint
     */
    id?: number;
    /**
     *
     * @type {number}
     * @memberof Datapoint
     */
    deviceId?: number;
}

/**
 *
 * @export
 * @interface Device
 */
export interface Device {
    /**
     *
     * @type {string}
     * @memberof Device
     */
