    /**
     *
     * @type {string}
     * @memberof Device
     */
    imsi?: string;
    /**
     * Bluetooth MAC Address as 48bit number
     * @type {number}
     * @memberof Device
     */
    btMac?: number;
    /**
     * Bluetooth MAC Address in standard format
     * @type {string}
     * @memberof Device
     */
    btMacAddress?: string;
    /**
     * UWB Address as 32bit number
     * @type {number}
     * @memberof Device
     */
    uwbId?: number;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    serial?: string;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    type?: string;
    /**
     *
     * @type {Date}
     * @memberof Device
     */
    expires?: Date;
    /**
     *
     * @type {Date}
     * @memberof Device
     */
    lastConnection?: Date;
    /**
     *
     * @type {Date}
     * @memberof Device
     */
    firstSeen: Date;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    mode?: string;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    name?: string;
    /**
     *
     * @type {number}
     * @memberof Device
     */
    batteryVoltage?: number;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    batteryType?: string;
    /**
     *
     * @type {Array<string>}
     * @memberof Device
     */
    tags?: Array<string>;
    /**
     * Indicates last known device state. 0 = awake, 1 = sleep, 6 = flight mode
     * @type {number}
     * @memberof Device
     */
    currentMode?: number;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    color?: string;
    /**
     *
     * @type {boolean}
     * @memberof Device
     */
    saveToWeb?: boolean;
    /**
     *
     * @type {boolean}
     * @memberof Device
     */
    active?: boolean;
    /**
     *
     * @type {boolean}
     * @memberof Device
     */
    deepSleep?: boolean;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    simstate?: string;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    stripeSubscription?: string;
    /**
     *
     * @type {string}
     * @memberof Device
     */
    subscriptionType?: string;
    /**
     *
     * @type {any}
     * @memberof Device
     */
    meta?: any;
    /**
     *
     * @type {number}
     * @memberof Device
     */
    resellerId?: number;
    /**
     *
     * @type {number}
     * @memberof Device
     */
    resellerPlanId?: number;
    /**
     *
     * @type {number}
     * @memberof Device
     */
    id?: number;
    /**
     *
     * @type {number}
     * @memberof Device
     */
    ownerId?: number;
    /**
     *
     * @type {number}
     * @memberof Device
     */
    securePhoneId?: number;
}

/**
 *
 * @export
 * @interface DeviceConfig
 */
export interface DeviceConfig {
    /**
     * Current Firmware version
     * @type {string}
     * @memberof DeviceConfig
     */
    currentFW?: string;
    /**
     * Pending Firmware version. If non null, the unit will be told to upgrade to this version when it next transmits in sleep mode.
     * @type {string}
     * @memberof DeviceConfig
     */
    otaFW?: string;
    /**
     * The wake mode interval in seconds. The unit will connect to the server this often when awake.
     * @type {number}
     * @memberof DeviceConfig
     */
    interval: number;
    /**
     * Sleep mode interval in seconds. The unit will try to connect this often to the server when asleep
     * @type {number}
     * @memberof DeviceConfig
     */
    sleepInterval: number;
    /**
     * DEPRECATED A failsafe to ensure the unit connects to the server at least this often.
     * @type {number}
     * @memberof DeviceConfig
     */
